const Recipe= ({allRecipes})=>{

    return (
        <React.Fragment>
           { 
            allRecipes.map(r=>(
                <p>r.id</p>,
                <p>r.name</p>
            ))
           
           }
        </React.Fragment>
    )
}

export default Recipe;
